C.aOH=new L.C("You can modify the breakpoint for when the switch between each navigation type occurs. The breakpoints also function as constraints for available navigation modes when users manually toggle between them. The current screen width and height is shown in the app bar in this demo, you can use it to observe that changes occur at set breakpoints.\n\nThe default breakpoint values work well for most devices and applications, but you can also adjust them via properties in FlexfoldThemeData. This demo allows you to adjust the breakpoints interactively to try the layout with other values.",null,null,null,null,null,null,null,null)
