C.aOL=new L.C("When the view switches to a rail or side menu, the tab view is an excellent choice and works really well for related views for the active destination. This page demonstrates this when you use a larger canvas that switches to rail or menu view.\n\nIn this example the tab bar is not anchored to bottom part of the app bar, it is in the top part of the body. The side bar is also present on this screen so we can see how it works with a tab bar view as well.",null,null,null,null,null,null,null,null)
