C.aOV=new L.C('Flexfold is primarily intended for Flutter applications that target Desktop and Web, but it is also great for resizable apps on tablets and Chrome books. It also works great for switching between portrait and landscape mode on phones and tablets, offering different navigation modes on them too. Flexfold is really useful when you make a single app that needs to support layout and navigation on phones, tablets, desktop and web, using the same code base.\n\nThis Flexfold feature demonstration uses named routing. You do not have to use named routes, but it is recommended. Named routes are easy with Flexfold and they also enable URL based routes if you plan to release your Flutter app on the Web. The "onDestinationSelected" callback provides not just a menu index of the tapped destination, but a class with the values that you see in each page header in this demo.\n',null,null,null,null,null,null,null,null)
