C.aPG=new L.C("For the page content layout, there is a Breakpoint class used to get suitable amount of columns for the grid images. It can be used to create different grid layouts all the way up to 4k widths. This screen is a nice stress test on a large canvas. If you maximize the screen on a 4K display and toggle the menu, the menu animation will cause all the SVG images on the screen to be rescaled and redrawn in every frame as the menu animates. It is a good stress test of Flutter and it actually works very well, much better than resizing windows in Flutter does. Window resizing and resulting redraws still need improvements in Flutter.\n\nThe Undraw images bundled with the app are used as demo content in the grid. Each image box that randomly display one of the images, has its own random wait duration before it switches, they also have a random switch animation time. Each image box gets a random colored border box, a less saturated version of the color is calculated for dark mode. Thus when you switch to dark mode, it still has the same color hue based on the light theme's random color. If you toggle the theme using the side menu toggle, you can see the difference. A nice detail is that each image is using its border color as a color theme of the image.\n\nThere are only 30 different images that are switched in randomly to each position in the grid. This demo list stops at 500 items in the grid. As such the page is not very useful, but it's a nice looking Flutter stress test, especially on the web.\n\nWith this page you can also test and see how Slivers work when the sidebar is a part of Scaffold body or outside it. It has bigger visual impact when a bottom navigation bar is used on a large canvas layout. Here we can use the toggle to always show the bottom navigation bar to see the difference. The setting that shows the bottom bar when the menu is manually hidden and sidebar remains pinned visible, is probably a more real use case for when the bottom navigation bar would be used on a large canvas.\n",null,null,null,null,null,null,null,null)
C.aPJ=new L.C('In addition to the tapped indexes, the destination\'s named route is included as a return value in the class. The "Tapped via" source, index change "Direction" are also included. You can use this information to determine how you want to navigate to the destination.\n\nThis demo shows how the destination information can be used to build different page transitions depending on which menu you navigate from. For example, from locked side menu there is no page transition. This works well with Web and desktop navigation. It is focused and quick, also animation of large surfaces on desktop sizes can be very distracting. At most a very quick and subtle fade through could be used if some navigation animation is desired. For this demo it was opted to not have any animation for this navigation type.\n\nFrom a rail or a drawer the FadeTrough transition from the Flutter Animations packages is used. This works well in tablet mode or when the direction of the navigation is uncertain. We can also see that only the actual content of the page animates. The rail, bottom bar, app bar and sidebar do not animate and remain fixed.\n\nThe bottom navigation uses a shared axis transition. This creates a slight sideways motion as the bottom destinations are clicked, without the same feeling that they are a part of same view that sliding animations imply, which would also suggest swiping navigation is available. Swiping navigation is not available here, since in this demo we consider the bottom navigation destinations to be independent of each other.\n\nThe purpose of these different page transition types are to use transitions that fit the most likely used device for the navigation type. This type of adaptive page transition, is not a part of Flexfold. However, the "onDestinationSelected" callback returns the information needed to implement it, like this demo does.\n',null,null,null,null,null,null,null,null)
C.aPN=new L.C("A toggle function to show and hide the menu is built in to the menu button. It can be used to hide the side menu or rail, to make more space available for app content. On a desktop sized canvas you can hide the menu completely or make it a rail. A similar toggle control is also available for the optional sidebar.\n\nThe tooltips on the settings below show the Flexfold API used and its current value based on the control setting. You can turn OFF the tooltips under Other settings. The purpose of these API tooltips is to function as an interactive reference guide to the Flexfold API.",null,null,null,null,null,null,null,null)
