C.aQr=new L.C("\nThis demo app does not expose any settings for the FABs, but the pages Setup and Theme have been configured to have and show Floating action buttons.\n\nWith the API the FAB position can also be defined for each navigation mode separately, so that the FAB shows up as expected on the bottom right in phone bottom navigation mode and on the top in tablet and desktop mode or wherever you want it to be in each mode.\n\nOn the todo list is to add some pre-configured FAB locations that will also place the FAB on the edge of the rail or menu.",null,null,null,null,null,null,null,null)
