C.aQD=new L.C("This demo shows how you can make app bars more interesting by introducing a gradient, together with optional transparency that increases gradually.\n\nThe reason for the gradient is just to make the app bar more dynamic and interesting. Whereas the gradient transparency is used to display content behind the app bar, as content scrolls below it.\n\nA transparent gradient that is fully opaque at the start of the app bar and increases in transparency towards the end, ensures that the title is always legible and keeps the effect subtle. A gradient and transparent app bar is still a matter of opinion and you can turn them off, as well as the scrolling behind the app bar or don't use the optional styled app bar constructor at all.\n",null,null,null,null,null,null,null,null)
C.aQE=new L.C("Menu animation duration",null,null,null,null,null,null,null,null)
C.aQF=new L.C("Side border on drawers in dark mode",null,null,null,null,null,null,null,null)
C.aQG=new L.C('This feature is required so you do not get stranded without a way back to bottom bar destinations in this navigation mode. Another and a better way to tackle this is to push the destinations that are only in the drawer in this navigation mode as new modal full screen on top of the entire Flexfold scaffold, with only back navigation option available. This is the normal and often preferred way of navigating from such extra drawer destinations on a phone.\n\nThis example application has been designed to do so by default, by using the "use modal" info returned by the FlexfoldSelectedDestination information for such destinations, which are Preview, Help and About in this demo app.\n\nEven when using this capability, it is still potentially possible to get stranded. If you in rail or menu mode navigate to Preview, Help or About the destination should not be pushed as a full screen with only back option, preferably we should only get the destination content replaced into the body part of the app. This demo app works this way. However, in this mode if you then resize the canvas to enable bottom navigation mode, the Preview, Help and About views in this app do not know that they should change to full screen view with a back button, to take you back to last used bottom navigation destination. With Flexfold, navigation to the bottom destinations will still be possible even in this rare scenario, since the destinations are now available in the drawer.',null,null,null,null,null,null,null,null)
C.aQH=new L.C("Break from rail to side menu at width",null,null,null,null,null,null,null,null)
C.aQI=new L.C("Full responsive layout of the content body in this app is not part of the Flexfold demo and has not been paid too much attention to, but it has been verified to work well enough from normal phone sizes to large web and desktop canvas sizes. The content presentation is however not always optimally designed for phones, mostly because it contains a lot of text and explanations.",null,null,null,null,null,null,null,null)
C.aQK=new L.C("The breakpoints for when the navigation mode changes, can be adjusted. The defaults work well enough for most use cases.\n\nTo keep the rail as slim as possible, navigation destination labels only appear as tooltips in rail mode. This results in a slim un-intrusive icon only rail, that is suitable for tablets in portrait mode and if so desired it can also be used in landscape mode on phones or even portrait mode on large phones in some use cases.\n\nThe end drawer can also become a permanent fixture on a wide enough canvas as a sidebar. The sidebar entrance is also animated. The sidebar's visibility can also be toggled with its menu button.\n\nThe width of the rail, side menu and the sidebar can all be individually adjusted. \n\nIn this demo you can play with the settings and observe Flexfold in action. The Flexfold API has a few more features than those demonstrated here.\n\nYou will find the key settings on the Setup page, but there are some usage hints on other pages in this demo as well.",null,null,null,null,null,null,null,null)
