C.aRr=new L.C("With Flexfold it is easy to include a gradient transparent app bar. There is a styled app bar factory to help make app bars like the one you see in this demo. When you combine the gradient transparent app bar with a white app bar theme, you get a Material themed app bar that resembles common iOS style app bars a bit. If you want to go full iOS style, then use the frosted glass blur style on a Material app bar as well. The frosted glass style is ON by default in this demo, but feel free to experiment with different settings.\n\nThis page uses a vertical scroll view that stops just before the tab bar, so you will not see the scroll behind app bar effect on this particular page. It is however visible on all other pages in this demo app.\n\nThe Settings page already contains the app bar settings below. This page just explains in a bit more detail how the app bar  made with the styled factory can be useful. There is also a feature that shows the current canvas size in the app bar. You can use it to verify that your responsive layouts work as designed during development.\n",null,null,null,null,null,null,null,null)
C.aRt=new L.C("You can enable DevicePreview on demand at runtime, just select device preview below and give it a try.",null,null,null,null,null,null,null,null)
C.aRu=new L.C("When you toggle the menus they will cycle via the drawer even when the menu or rail can be opened based on breakpoint settings. Keep OFF to skip the step via the drawer.",null,null,null,null,null,null,null,null)
C.aRv=new L.C("When you have destinations in a bottom navigation bar and additional destinations in a drawer, you usually want the navigation to such additional destinations to be modal when you navigate to them and your canvas is phone sized that does not show all the destinations in a rail or side menu.\n\nWith Flexfold you can use the source of the navigation to determine if you want push a full screen route on top of the Flexfold scaffold with only back option available or push a replacement named version of it, into the body part.\n\nFlexfold does not normally show bottom navigation bar destinations in the drawer during bottom bar navigation mode. However, if you navigate to a destination in bottom navigation mode that is not on the bottom navigation bar, then if you open the drawer again after this, you will find the bottom navigation bar destinations in the drawer.\n",null,null,null,null,null,null,null,null)
C.aRw=new L.C("This demo uses the newer Flutter Material 2018 typography, which creates a slightly different look compared to the older 2014 standard.\n",null,null,null,null,null,null,null,null)
